import './App.css';
import React from 'react';

export default class App extends React.Component {
  render() {
    return (
      <div className="root">
        <Name />
        <Portrait  />
        <Header />
        <AboutMe />
        <Coursework />
      </div>
    );
  }
}

class Header extends React.Component {
  render(){
    return (
      <div className="header">
        <Tab name="About me"/>
        <Tab name="Courses"/>
        <Tab name="Projects"/>
      </div>
    );
  }
}

class Tab extends React.Component {
  render() {
    return (
      <div className="Tab">
      <h3>{this.props.name}</h3>
      </div>
    );
  }
}

class Name extends React.Component {
  render(){
    return (
      <div className="name">
         <h1> Emad Siddiq </h1>

      </div>
    );
  }
}

class Portrait extends React.Component{
  render(){
    return(
    <div className="Portrait">
      <img src="portrait.jpg" height="400" width="300" alt='me with a grad cap'/>
      </div>
    );
  }
}



class AboutMe extends React.Component {
  render(){
    return (
      <div className="About Me">

        <p>Welcome! I recently graduated from the University of California Berkeley with a double major
        in Political Economy and Data Science.</p>


        <p>While at Berkeley I was proud to be a Community Service Officer, helping people walk
        safely home. I was also a member of BMUN, an annual conference for teaching Model UN and diplomacy to 
        high school students.
        </p>

        <p> I am a great believer in using the power of technology for social good and hence my interests lies in the application of Artificial Intelligence to solving societal
        problems since . This aspiration arose from my paricipation in a summer program by the Haas School of Business & Université de Genève - <a href="https://www.youtube.com/watch?v=xLjJaNq0kqQ">
        "Business Innovation for Sustainability, Social Responsibility and Positive Impact."</a>
        </p> 


        <p>
        I was born in Najran, Saudi Arabia, grew up in Islamabad, Pakistan and was fortunate to attend the
        <a href = "https://www.uwcad.it/"> United World College of Adriatic </a> in Duino, Italy. At UWC I met and became
        friends with people from every corner of the world and learnt the importance of mutual understanding and cultural
        exchange. 
        </p> 

        <p> Since this was at the height of the Refugee Crisis
          my friends and I volunteered with various refugee organisations in <a href ="https://www.youtube.com/watch?v=oSBV4TrR7k0">Innsbruck, Austria</a> and
        Palermo, Udine, Monfalcone and Trieste in Italy. My close friend, <a href = "https://www.linkedin.com/in/danielegerbino/">
        Daniele Gerbino</a>, and I were also regular visitors to Fondazione Luchetta in Trieste, a charity organisation that offered 
        free treatment to children from conflict zones. </p>

        <p> I look forward to whatever adventure comes next. </p>
    </div>
    );


  }
}

class Coursework extends React.Component {
  render(){
    return (
      <div className="Coursework">
        <h1> Select Courses </h1>
        <h3>Political Economy related:</h3>
        <ul>
          <li>South Asian 147: Pakistan</li>
          <li>Polecon 156: Silicon Valley and the Global Economy </li>
          <li>PE 100: Classical Theories of Political Economy </li>
          <li>PE 101: Contemporary Theories of Political Economy</li>
          <li>Legal Studies 190: Information, Media and the Public Discourse</li>
          <li> Econ 100A: Intermediate Microeconomics </li>
          <li> Econ 100B: Intermediate Macroeconomics </li>
          <li>Economics 141: Econometric Analysis </li>
        </ul>

        <h3> CS related </h3>
        <ul>
          <li>CS 61A: Structure and Interpretation of Computer Programs</li>
          <li>CS 61B: Data Structures and Algorithms </li>
          <li>Data 100: Principles and Techniques of Data Science</li>
          <li> Math 54: Linear Algebra </li>
          <li>Stat 140: Probability for Data Science </li>
          <li>Data C104: Ethics of Data</li> 
          <li>CS 189: Machine Learning </li>
          <li> CS 170: Efficient Algorithms and Intractable Problems</li>
        </ul>


      </div>
    )
  }
}

class Projects extends React.Compoenent {
  render() {
    return (
      <div>
        <h1>Projects</h1>
        <h3>Dictionary of Pashto</h3>

      </div>
    )
  }
}
